def test(got, expected, order = 0):
    if isinstance(got, float) and isinstance(expected, float):
        if abs(got - expected) <= 0.0001:
            print("OK! got: " + str(got) + ", expected: " + str(expected))
            return 1
        else:
            print("WA! got: " + str(got) + ", expected: " + str(expected))
            return 0
    elif isinstance(got, list) and isinstance(expected, list) and not order:
        if got.sort() == expected.sort():
            print("OK! got: " + str(got) + ", expected: " + str(expected))
            return 1
        else:
            print("WA! got: " + str(got) + ", expected: " + str(expected))
            return 0
    else:
        if got == expected:
            print("OK! got: " + str(got) + ", expected: " + str(expected))
            return 1
        else:
            print("WA! got: " + str(got) + ", expected: " + str(expected))
            return 0

